import React from 'react';
import { Influencer } from '../types/Influencer';

interface Props {
    data: Influencer | null;
}

const InfluencerTable: React.FC<Props> = ({ data }) => {
    if (!data) return <div>No data available</div>;

    return (
        <table>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Platform</th>
                    <th>Followers</th>
                    <th>Total Posts</th>
                    <th>Total Likes</th>
                    <th>Total Comments</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>{data.name}</td>
                    <td>{data.platform}</td>
                    <td>{data.followers}</td>
                    <td>{data.totalPosts}</td>
                    <td>{data.totalLikes}</td>
                    <td>{data.totalComments}</td>
                </tr>
            </tbody>
        </table>
    );
};

export default InfluencerTable;
